import { NavLink } from 'react-router-dom';
import Common from './Common';
// import web from '../project1/images/img2.svg';
const web='';

const Home =()=>{
    return(
        <>
            <Common name="Grow Up Your Business" imgsrc={web} visit="/service" btnname="Get Started"/>
        </>
    );
};

export default Home;
